import React, { Component } from 'react';

class Products extends Component {
    render() { 

        return (
            <div>
                <h1>{this.props.name}</h1>
                <p>{this.props.price}</p>
                <p>{this.props.stock}</p>
                <p><button className="btn-action">Action</button></p>
            </div>
        );
    }
}
 
export default Products;
